style.css:
@-moz-document domain("mail.google.com") {
/* .la-c is for the new 2020 gmail design */

#loading > div > .la-e > * {
  display: none;
}

#loading > div > .la-e {
    height: 168px !important;
    width:  272px !important;
    background: transparent url("data:image/gif;base64,") center no-repeat !important;
    
    animation-name: spin;
    animation-duration: 8000ms;
    animation-iteration-count: infinite;
    animation-timing-function: linear; 
}
}

